import React from 'react';
import PropTypes from 'prop-types';
import 'antd/dist/antd.css'

const earlyBird = ({ Component }) => {
    return (
        <Component />
    );
};

earlyBird.propTypes = {
    Component: PropTypes.elementType.isRequired
}

export default earlyBird;
